import Seances from './components/Seances';
import './App.css';


class App extends Component {
  render(){
    return (
      <div className="page-container">
        <NavBar/>

        <ScrollableTabsButtonAuto/>
        <Seances/>




      </div>


    );
  }
}


export default App;
